"ko": |-
  단일 바이트 식별자의 네임스페이스가 너무 작기 때문에 하위 레지스트리에 포함된 0-255 범위의 향후 추가에 대한 IANA 정책은 [RFC5226]에 설명된 "전문가 검토"입니다. 10000-64999 범위의 추가에 대한 IANA 정책은 [RFC5226]에 설명된 대로 "선착순"입니다. 이는 다음 표에 요약되어 있습니다.
